●各種金型の仕上げ・修正・R取りなどに必要な形状の合金に適正な粒度のダイヤモンドを独自の電着技術でヤスリ合金に強固に配列させたグレードの高い商品です。●厳密な素材管理によって、高精度・高強固・シャープなエッジのヤスリを提供いたします。●ヤスリのグリップに商品名を印字し、粒度によりグリップの色分けをしているので管理と再オーダーが簡単です。<BR>●各種金型の仕上げ・修正・R取り・各種刃物研削など、硬質脆性材料の研削に最適。●小径穴・面取りなどにも。<BR>●形状:平 （幅）6.0×（厚み）0.8●全長(mm):175●刃長(mm):40●柄の形状:丸 （φ3.6mm）●粒度(#):140●質量(g):9<BR>●炭素工具鋼<BR>●力を入れずに使用してください。目づまり時は灯油などを使い、ブラシで洗ってください。<tr><td colspan="2">
